import React, { useState, useEffect } from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Nav from "./components/Nav";
import Components from "./components";

import ReactLoading from "react-loading";
import CompanyData from "./companyData";

// POP UP COMPONENTS IMPORT
import PopUpsHandler from "./components/popUps/PopUpsHandler";

// style component
import "./app.css";

function App() {
  const [loading, setLoading] = useState(false);
  useEffect(() => {
    setLoading(true);
    setTimeout(() => {
      setLoading(false);
    }, 3000);
  }, []);
  return (
    <>
      {loading ? (
        <div className="loadingPage">
          <ReactLoading type="cylon" color="green" height={100} width={100} />
        </div>
      ) : (
        <div div className="app">
          <CompanyData>
            <Nav loading={loading} />
            {/* <PopUpsHandler />
            <Components /> */}
            <Router>
              <Route path="/" exact element={<Components />} />
              <Route path="/book" element={<PopUpsHandler />} />
            </Router>
          </CompanyData>
        </div>
      )}
    </>
  );
}

export default App;
